<style>
  #us-map{
  display: block;
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
}
path:hover, circle:hover {
  stroke: #EFA64D !important;
  stroke-width:2px;
  stroke-linejoin: round;
  fill: #EFA64D !important;
  cursor: pointer;
}
#path67 {
  fill: none !important;
  stroke: #A9A9A9 !important;
  cursor: default;
}
#info-box {
  display: none;
  position: fixed;
  top: 0px;
  left: 0px;
  z-index: 1;
  background-color: #ffffff;
  border: 2px solid #a1a;
  border-radius: 5px;
  padding: 5px;
  font-family: arial;
}
    .popup { 
  position: fixed;
  top: 50%;
  left: -40%;
  transform: translateY( -50%);
  background-color: #a1a;
  padding: 20px;
  border: 1px solid #ccc;
  box-shadow: 0 0 10px rgba(0, 0, 0, 0.5);
  opacity: 0;
  transition: all 750ms ease;
  height: 200px;
}

.clickable {
    width: 100px;
  cursor: pointer;
  margin: 10px;
  padding: 10px;
  float: left;
  background-color: #f0f0f0;
}
.popup.active{ 
  left: 0;
  opacity: 1;
}
</style>

  <script>


$(document).ready(function() {
  // Attach click event listener to each clickable div
  $('.clickable').click(function() {
    // Remove the 'active' class from all popups
    $('.popup').removeClass('active');

    // Get the corresponding popup ID from the data attribute
    var popupId = '#' + $(this).data('popup-id');

    // Add the 'active' class to the corresponding popup
    $(popupId).addClass('active');
  });

  // Close the popup when clicking outside of it
  $(document).click(function(event) {
    if (!$(event.target).hasClass('clickable') &&
        !$(event.target).hasClass('popup')) {
      // Remove the 'active' class from all popups
      $('.popup').removeClass('active');
    }
  });
});
